import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';
import styles from '../components/NotGirPage.module.css'; // CSS varsa

const NotGirPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const teacher = location.state?.teacher;

  const [students, setStudents] = useState([]);
  const [selectedStudentId, setSelectedStudentId] = useState('');
  const [examType, setExamType] = useState('');
  const [grade, setGrade] = useState('');
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState(null);

  useEffect(() => {
    const fetchStudents = async () => {
      try {
        // Öğretmenin öğrencilerini API'den çekiyoruz
        const res = await axios.get(`http://localhost:8080/api/teacher/${teacher?.id}/students`);
        setStudents(res.data);
      } catch (error) {
        console.error('Öğrenci listesi alınamadı:', error);
      } finally {
        setLoading(false);
      }
    };

    if (teacher?.id) {
      fetchStudents();
    } else {
      setLoading(false);
    }
  }, [teacher]);

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!selectedStudentId || !examType || !grade) {
      setMessage({ type: 'error', text: 'Lütfen tüm alanları doldurun.' });
      return;
    }

    try {
      await axios.post('http://localhost:8080/api/grades', {
        teacherId: teacher.id,
        studentId: selectedStudentId,
        examType,
        grade: Number(grade),
      });

      setMessage({ type: 'success', text: 'Not başarıyla kaydedildi.' });

      setSelectedStudentId('');
      setExamType('');
      setGrade('');
    } catch (error) {
      console.error('Not kaydedilemedi:', error);
      setMessage({ type: 'error', text: 'Not kaydedilirken hata oluştu.' });
    }
  };

  if (loading) return <div>Yükleniyor...</div>;

  if (!teacher) return <div>Öğretmen bilgisi bulunamadı. Lütfen tekrar giriş yapınız.</div>;

  return (
    <div className={styles.container}>
      <h2>Not Girişi</h2>

      {message && (
        <div
          style={{
            color: message.type === 'error' ? 'red' : 'green',
            marginBottom: '1rem',
          }}
        >
          {message.text}
        </div>
      )}

      <form onSubmit={handleSubmit} className={styles.form}>
        <label>
          Öğrenci Seçin:
          <select
            value={selectedStudentId}
            onChange={(e) => setSelectedStudentId(e.target.value)}
          >
            <option value="">-- Seçiniz --</option>
            {students.map((student) => (
              <option key={student.id} value={student.id}>
                {student.studentNumber} - {student.name} {student.surname}
              </option>
            ))}
          </select>
        </label>

        <label>
          Sınav Türü:
          <select
            value={examType}
            onChange={(e) => setExamType(e.target.value)}
          >
            <option value="">-- Seçiniz --</option>
            <option value="vize">Vize</option>
            <option value="final">Final</option>
            <option value="but">Bütünleme</option>
          </select>
        </label>

        <label>
          Not:
          <input
            type="number"
            min="0"
            max="100"
            value={grade}
            onChange={(e) => setGrade(e.target.value)}
          />
        </label>

        <button type="submit" className={styles.submitButton}>Notu Kaydet</button>
      </form>

      <button onClick={() => navigate(-1)} className={styles.backButton}>
        Geri Dön
      </button>
    </div>
  );
};

export default NotGirPage;
